<!DOCTYPE html>
<html lang="ru">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Поздравляем с Свадьбой!</title>
    <style>
        body {
            margin: 0;
            padding: 0;
            background-color: #ffd6e7;
            font-family: 'Courier New', monospace;
            overflow: hidden;
            height: 100vh;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            text-align: center;
        }
        
        .card-container {
            position: relative;
            width: 100%;
            height: 100%;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
        }
        
        .card-content {
            background-color: rgba(255, 255, 255, 0.8);
            border-radius: 15px;
            padding: 20px;
            max-width: 90%;
            position: relative;
            box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2);
        }
        
        h1 {
            color: #ff6392;
            font-size: 24px;
            margin-bottom: 20px;
        }
        
        .pixel-couple {
            display: flex;
            justify-content: center;
            align-items: center;
            margin: 20px 0;
            position: relative;
        }
        
        .groom, .bride {
            width: 100px;
            height: 200px;
            image-rendering: pixelated;
            transition: transform 0.5s;
        }
        
        .heart {
            position: absolute;
            font-size: 24px;
            color: red;
            opacity: 0;
            animation: float 2s infinite;
        }
        
        .sparkle {
            position: absolute;
            width: 10px;
            height: 10px;
            background-color: gold;
            border-radius: 50%;
            opacity: 0;
        }
        
        @keyframes float {
            0% { transform: translateY(0); opacity: 0; }
            50% { transform: translateY(-20px); opacity: 1; }
            100% { transform: translateY(-40px); opacity: 0; }
        }
        
        .btn {
            background-color: #ff6392;
            color: white;
            border: none;
            padding: 12px 20px;
            border-radius: 8px;
            font-size: 16px;
            cursor: pointer;
            margin: 10px;
            transition: all 0.3s;
        }
        
        .btn:hover {
            background-color: #e93f7c;
            transform: scale(1.05);
        }
        
        .confetti {
            position: absolute;
            width: 10px;
            height: 10px;
            opacity: 0;
        }
        
        .hidden {
            display: none;
        }
        
        .next-page {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            background-color: #ffd6e7;
            opacity: 0;
            transition: opacity 1s;
            z-index: -1;
        }
        
        .show {
            opacity: 1;
            z-index: 10;
        }
        
        .ring {
            font-size: 40px;
            margin: 10px;
            animation: pulse 2s infinite;
        }
        
        @keyframes pulse {
            0% { transform: scale(1); }
            50% { transform: scale(1.2); }
            100% { transform: scale(1); }
        }
        
        .back-btn {
            position: absolute;
            top: 10px;
            left: 10px;
            background-color: #ff6392;
            color: white;
            border: none;
            padding: 8px 12px;
            border-radius: 5px;
            cursor: pointer;
        }
        
        #fileInput {
            display: none;
        }
        
        .custom-file-upload {
            border: 1px solid #ccc;
            display: inline-block;
            padding: 6px 12px;
            cursor: pointer;
            background-color: #f8f8f8;
            border-radius: 4px;
            margin-top: 10px;
        }
        
        .pixel-border {
            border: 8px solid transparent;
            border-image: url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAgAAAAICAYAAADED76LAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAB3RJTUUH4AkZCyYFl2jR0QAAAFRJREFUGNNjZGBg+M+ABxw9evQ/AxpgYsADwIr//4/F3QyMOP0N1owh8P9oOCMjAwPDUSZGRgYGhlBGXO5mYDh6NJSRgYHhKCMewyCHQySIAbEDAF+jHBsoZRqVAAAAAElFTkSuQmCC') 8 repeat;
            padding: 16px;
        }
        
        /* #audioPlayer {
            margin-top: 20px;
        } */
    </style>
</head>

    <div class="next-page" id="nextPage">

    <script>
        document.addEventListener('DOMContentLoaded', function() {
            // Elements
            const kissButton = document.getElementById('kissButton');
            const confettiButton = document.getElementById('confettiButton');
            const groom = document.getElementById('groom');
            const bride = document.getElementById('bride');
            const pixelCouple = document.querySelector('.pixel-couple');
            const mainCard = document.getElementById('mainCard');
            const nextPage = document.getElementById('nextPage');
            const backButton = document.getElementById('backButton');
            const fileInput = document.getElementById('fileInput');
            const audioPlayer = document.getElementById('audioPlayer');
            
            // Try to autoplay (may be blocked by browser)
            audioPlayer.play().catch(e => {
                console.log("Autoplay prevented. User interaction needed.");
            });
            
            // Kiss animation
            let isKissing = false;
            
            kissButton.addEventListener('click', function() {
                if (!isKissing) {
                    isKissing = true;
                    
                    // Move characters closer
                    groom.style.transform = 'translateX(20px)';
                    bride.style.transform = 'translateX(-20px)';
                    
                    // Create hearts
                    createHearts();
                    
                    // Create sparkles
                    createSparkles();
                    
                    // Reset after animation
                    setTimeout(() => {
                        groom.style.transform = 'translateX(0)';
                        bride.style.transform = 'translateX(0)';
                        isKissing = false;
                        
                        // Show next page after a few kisses (random chance)
                        if (Math.random() > 0.7) {
                            setTimeout(() => {
                                mainCard.style.opacity = '0';
                                nextPage.classList.add('show');
                            }, 1000);
                        }
                    }, 2000);
                }
            });
            
            // Go back to first page
            backButton.addEventListener('click', function() {
                nextPage.classList.remove('show');
                mainCard.style.opacity = '1';
            });
            
            // Confetti animation
            confettiButton.addEventListener('click', createConfetti);
            
            // Functions
            function createHearts() {
                const heartCount = 10;
                
                for (let i = 0; i < heartCount; i++) {
                    const heart = document.createElement('div');
                    heart.className = 'heart';
                    heart.innerHTML = '❤️';
                    heart.style.left = `${50 + (Math.random() * 30 - 15)}%`;
                    heart.style.top = `${40 + (Math.random() * 10)}%`;
                    heart.style.fontSize = `${12 + Math.random() * 12}px`;
                    heart.style.animationDelay = `${Math.random() * 0.5}s`;
                    
                    pixelCouple.appendChild(heart);
                    
                    setTimeout(() => {
                        pixelCouple.removeChild(heart);
                    }, 2000);
                }
            }
            
            function createSparkles() {
                const sparkleCount = 15;
                
                for (let i = 0; i < sparkleCount; i++) {
                    const sparkle = document.createElement('div');
                    sparkle.className = 'sparkle';
                    sparkle.style.left = `${50 + (Math.random() * 40 - 20)}%`;
                    sparkle.style.top = `${40 + (Math.random() * 20)}%`;
                    sparkle.style.width = `${2 + Math.random() * 5}px`;
                    sparkle.style.height = sparkle.style.width;
                    
                    // Animation
                    sparkle.style.opacity = '1';
                    sparkle.style.transform = `translate(${Math.random() * 40 - 20}px, ${Math.random() * 40 - 20}px)`;
                    sparkle.style.transition = `all ${0.5 + Math.random() * 0.5}s ease-out`;
                    
                    pixelCouple.appendChild(sparkle);
                    
                    setTimeout(() => {
                        sparkle.style.opacity = '0';
                        setTimeout(() => {
                            pixelCouple.removeChild(sparkle);
                        }, 500);
                    }, 100);
                }
            }
            
            function createConfetti() {
                const confettiCount = 50;
                const colors = ['#f94144', '#f3722c', '#f8961e', '#f9c74f', '#90be6d', '#43aa8b', '#577590'];
                
                for (let i = 0; i < confettiCount; i++) {
                    const confetti = document.createElement('div');
                    confetti.className = 'confetti';
                    confetti.style.left = `${Math.random() * 100}%`;
                    confetti.style.top = '0';
                    confetti.style.backgroundColor = colors[Math.floor(Math.random() * colors.length)];
                    confetti.style.width = `${5 + Math.random() * 5}px`;
                    confetti.style.height = `${10 + Math.random() * 10}px`;
                    confetti.style.opacity = '1';
                    confetti.style.transform = 'rotate(0deg)';
                    
                    document.body.appendChild(confetti);
                    
                    // Animation
                    setTimeout(() => {
                        confetti.style.opacity = '1';
                        confetti.style.transform = `translateY(${100 + Math.random() * 200}px) rotate(${Math.random() * 360}deg)`;
                        confetti.style.transition = `all ${1 + Math.random() * 2}s ease-out`;
                        
                        setTimeout(() => {
                            confetti.style.opacity = '0';
                            setTimeout(() => {
                                document.body.removeChild(confetti);
                            }, 1000);
                        }, 1000);
                    }, 10);
                }
            }
            
            // Pixel-style image loading fallback
            groom.onerror = function() {
                groom.src = "/api/placeholder/100/200";
            };
            
            bride.onerror = function() {
                bride.src = "/api/placeholder/100/200";
            };
        });
    </script>
</body>
</html>
